contracts/MetaWorld.sol.content:
pragma solidity >=0.6.0 <0.8.0;
import "./ERC1155Base.sol";

import "@openzeppelin/contracts/math/SafeMath.sol";

contract MetaWorld is ERC1155Base {
    using SafeMath for uint;
    uint256 public total;
  
    mapping(uint=>world) public MetaWorlds;


    event WorldCreated(uint _id,bytes32 _specifications,uint256 _totalShares,uint256 _sharePrice,uint256);
    struct world{
        uint id;
        bytes32 specification;       
        uint256 totalshares;
        uint256 allocatedShares;
        uint256 sharePrice;
        uint256 saleStart;             
    }
    
    modifier saleHasStarted(uint256 w){
        world storage Instance = MetaWorlds[w];
        require(block.timestamp>=Instance.saleStart,"sale has not started");       
     _;   
    }
    
  constructor(string memory uri) public  ERC1155Base(uri){
       
    }
    
    function createWorld(bytes32 _spec,uint256 total_shares,uint256 _price,uint256 _start)  public isAdmin(msg.sender){
        total=total+1;
        world memory newWorld= world(total,_spec,total_shares,0,_price,_start);
        MetaWorlds[total]=newWorld;
    }
    function updateWorld(uint256 w,bytes32 _spec,uint256 total_shares,uint256 _price,uint256 _start)  public isAdmin(msg.sender){
         world storage current = MetaWorlds[w];
         current.specification=_spec;
         current.totalshares=total_shares;
         current.sharePrice=_price;
         current.saleStart=_start;
    }
   
    function grantWorldShare(uint _shares,uint _world,address recipient)  public isAdmin(msg.sender){
        world storage Instance = MetaWorlds[_world];
        require(Instance.totalshares>=Instance.allocatedShares.add(_shares),"not enough shares are available");
        uint tokenid= Instance.id;
        Instance.allocatedShares=Instance.allocatedShares.add(_shares);
        _mint(recipient, tokenid, _shares,"");
    }


  

}

