contracts/WorldAdmin.sol.content:
pragma solidity >=0.6.0 <0.8.0;

import "@openzeppelin/contracts/access/AccessControl.sol";

contract WorldAdmin is AccessControl {
     bytes32 public constant METAVERSE_ADMIN = keccak256("METAVERSE_ADMIN");

    modifier isAdmin(address a){
       require(hasRole(METAVERSE_ADMIN,a));
    _;
    }
    modifier isGlobalAdmin(address a){
       require(hasRole(DEFAULT_ADMIN_ROLE,a));
    _;
    }
    constructor() public {
        _setupRole(DEFAULT_ADMIN_ROLE, _msgSender());
        _setupRole(METAVERSE_ADMIN, _msgSender());
        _setRoleAdmin(DEFAULT_ADMIN_ROLE,METAVERSE_ADMIN);
    }

    
}

